import React from "react";

const Link=({href,children})=>{
    const changeURL=(e)=>{
        e.preventDefault()
        window.history.pushState({},'',href)
        window.dispatchEvent(new Event('popstate'))
        return
    }

    return(
        <a href={href}>
            {children}
        </a>
    )
}

export default Link
